import React from 'react';
import { Link } from 'react-router-dom';

// You can replace 'YourLogo.png' with the actual path to your logo file
import YourLogo from '../Components/HBlogo.png';

const Navbar = ({username}) => {
  console.log(username + " is the username");
  const isAuthenticated = true; // You can replace this with your actual authentication logic

  return (
    <nav className="bg-black text-gray-500 shadow-lg top-0">
      <div className="max-w-full px-4 flex justify-between items-center h-24">
        <div className="flex items-center">
        <Link to="/" >
        <img src={YourLogo} alt="Healthbook Logo" className="h-28 mr-20" />
          </Link>
          
  
          <Link to="/" className="hover:text-black mr-8 text-2xl">Home</Link>
          <Link to="/prescriptions" className="hover:text-black mr-8 text-2xl">Prescriptions</Link>
          <Link to="/tests" className="hover:text-black mr-8 text-2xl">Tests</Link>
          <Link to="/currentMedication" className="hover:text-black text-2xl">Current Medication</Link>
          
        </div>

        <div className="flex items-center space-x-4">
          

          {isAuthenticated ? (
            <div className="flex items-center space-x-4">
              <Link to="/profile" className="bg-blue-500 text-2xl font-poppins text-white p-3 rounded-full hover:bg-blue-700">if()username !{username}</Link>
              <button className="hover:text-gray-300 text-2xl bg-red-400 p-3">Logout</button>
            </div>
          ) : (
            <div className="flex items-center space-x-4">
              <Link to="/login" className="hover:text-gray-300 bg-myblue p-3 ml-8 text-2xl">Login</Link>
              <Link to="/signup" className="hover:text-gray-300 bg-myblue p-3 ml-8 text-2xl">Signup</Link>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
